import React from "react";

const WatchContent = () => {
  return (
    <body>
      <div class="container">
        <video
          src="../../media/vid-1.mp4"
          class="slider"
          loop
          muted
          controls
        ></video>
        <ul>
          <li>
            <video src="../../media/vid-1.mp4"></video>
          </li>
          <li>
            <video src="../../media/vid-2.mp4"></video>
          </li>
        </ul>
      </div>
    </body>
  );
};

export default WatchContent;
